        headers.append("Content-Type", "application/json");
        headers.append("Phosphor-Api-Key", this.phosphorApiKey);
        try {
            const response = await fetch(`${this.phosphorEndpoint}${endpoint}`, {
                method,
                headers,
                body: body ? JSON.stringify(body) : undefined,
